import style from "./SignUpForm.module.scss";
import { Header } from "../Header/Header";

const SignUpForm = () => {
  return (
    <div>
      <Header />
      <div className={style.formContainer}>
        <h1 className={style.formTitle}>Добро пожаловать в Arlezu!</h1>
        <h2 className={style.formSubTitle}>Как тебя зовут?</h2>
        <form>
          <input type="text" />
          <input type="email" />
          <input type="password" />
        </form>
      </div>
    </div>
  );
};

export { SignUpForm };
